	import React, { useState,useEffect } from 'react';
	import {STLViewer} from 'react-stl-obj-viewer';
	import {  Button } from '@material-ui/core';
	import { BackspaceIcon,IconButton } from '@material-ui/icons/Backspace';
	import ReactDOM from 'react-dom';



	function STLDisplay(props){

		const [aux, setaux] = useState([]);
		const [backColor, ] = useState("#b0b0b0");

		useEffect(() => {   
			setaux([props.file])
			props.setUnavailable()
		},[props.file]);

		function deleteid(){
			props.setAvailable()
			setaux([])
		}

	return(
		<div>

		    <IconButton color="primary" aria-label="Display" onClick={deleteid}>
              <BackspaceIcon fontSize="large"/>
            </IconButton>	

			{aux.map(auxModel=>
				<STLViewer
				key={auxModel.id+256}
				width={800}
				height={400}
				sceneClassName="test-scene"
				file={auxModel}
				className="stl"
				modelColor="#FF0000"
				backgroundColor={backColor}
				/> 
			)
			}

		</div>
	)};

	export default STLDisplay;
